import React from 'react';

const ShoppingList = () => {
  const users = [
    { title : 'test' , isFruit: false , id : 1},
    { title : 'user' ,  isFruit: false , id : 2},
    { title : 'xyz' , isFruit: false , id : 3},
    { title : 'helow' , isFruit: false , id : 4},
    { title : 'world' , isFruit: true , id : 5}
  ]

  const listitems =  users.map(names =>
    <li
    key = {names.id}
    style={{
      color: users.isFruit ? 'red' : 'yellow' 

    }}
    >

    {names.title}
    </li>
    )
    return(
    <ul>
      {listitems}
    </ul>
    );
}

export default ShoppingList;
